import { __decorate } from "tslib";
import { HttpParams } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { HttpService } from '@core-service/http.service';
import { environment } from 'src/environments/environment';
let TrmService = class TrmService {
    constructor(http) {
        this.http = http;
    }
    consultarPorFuera(fecha) {
        const query = `SELECT * WHERE vigenciadesde>="${fecha}" ORDER BY vigenciahasta DESC`;
        const httpParams = new HttpParams().set('$query', query);
        return this.http.doGetParameters(`${environment.urlTrm}`, httpParams, this.http.optsTrm(`${environment.tokenTrm}`));
    }
};
TrmService.ctorParameters = () => [
    { type: HttpService }
];
TrmService = __decorate([
    Injectable()
], TrmService);
export { TrmService };
